function uploadFileS3(pdfBuffer, fileName, transactionType){
  try {
      let s3Bucket;
      s3Bucket = new AWS.S3({
          accessKeyId: process.env.AWS_S3_ACCESS_KEY_ID,
          secretAccessKey: process.env.AWS_S3_ACCESS_KEY_SECRET,
          region: process.env.AWS_S3_REGION,
          params: {
              Bucket: process.env.AWS_S3_BUCKET_NAME
          }
      });

      let filePath = `dpiupload/${fileName}.pdf`;
      let pdfData = {
          Key: filePath,
          Body: pdfBuffer,
          ContentType: "application/pdf",
          CacheControl: "max-age=172800"
      };

      return new Promise((resolve) => {
          s3Bucket.upload(pdfData, function (err, data) {
              if (err) {
                  console.error(err);
                  reject(false);
              }
              if (process.env.AWS_CLOUDFRONT_URL) {
                  resolve(process.env.AWS_CLOUDFRONT_URL + data.Key);
              } else {
                  resolve(data.Location);
              }
          });
      });

  } catch (error) {
      
  }
  

}

const puppeteer = require('puppeteer');

async function htmlToBase64Pdf(htmlContent) {
    const browser = await puppeteer.launch();
    const page = await browser.newPage();

    // Set the content of the page to the provided HTML
    await page.setContent(htmlContent, { waitUntil: 'networkidle0' });

    // Generate a PDF buffer
    const pdfBuffer = await page.pdf({ format: 'A4' });

    await browser.close();

    // Convert the PDF buffer to base64
    const base64Pdf = pdfBuffer.toString('base64');
    return base64Pdf;
}

async function htmlToPdfBuffer(htmlContent) {

  const browser = await puppeteer.launch(
    {
      headless: true,
      args: ["--no-sandbox"],
      executablePath: '/usr/bin/google-chrome'
    }
    );
  const page = await browser.newPage();

  // Set the content of the page to the provided HTML
  await page.setContent(htmlContent, { waitUntil: 'networkidle0' });

  // Generate a PDF buffer
  const pdfBuffer = await page.pdf({ format: 'A4' });

  await browser.close();

  return pdfBuffer;
}






